let questionsArray = [
  {
    serialNo: "3.1",
    question:
      "Is the address given in the license or application for license same as the current address of the place of business?",
    num: "1",
  },
  {
    serialNo: "3.2 (5.1.x)",
    question:
      "Is a copy of RPS license granted under these rules prominently displayed at the premises of the RPS at a place accessible to public?",
    num: "2",
  },
];
export default questionsArray;
